import React from 'react'

export default function Newslist(props) {
  return (
   <div className="col-3 mx-1 my-3 card p-1" style={{maxWidth: "35vw", maxHeight: "75%", textOverflow: "ellipsis"}}>
    <img src={props.imageURL} alt={props.title} />
    <h4 className='h3' style={{maxLines: "2",maxHeight: "px", lineHeight: "22px", overflow:"hidden"}}>{props.title}</h4>
    <p className='p desc text-disabled'>{props.desc}</p>
   </div>
  )
}
